import React from 'react';
import Moment from 'react-moment';
import PropTypes from 'prop-types';

const LogItem = ({ log }) => {
    return (
        <li className="collection-item">
            <div>
                <a href="#edit-log-modal" className={`modal-trigger ${log.attention ? 'red-text' : 'blue-text'}`}>{log.message}</a>
                <br/>
                <span className='grey-text'>
                    <span className="black-text">ID #{log._id}</span> last updated by <span className="black-text">{log.tech}</span> on <Moment format="MMM Do YYYY, h:mm:ss a"></Moment>
                </span>
            </div>
        </li>
    )
}

LogItem.propTypes = {
    log: PropTypes.object.isRequired,
}

export default LogItem
